import Header from "./components/header/Header";
import 'bootstrap/dist/css/bootstrap.css';
import MainCard from "./components/mainPage/MainCard";
import { Button } from 'reactstrap';
function App() {
  return (
    <div className="light">
      <Header />

        <MainCard />

        <Button color="primary">Primary</Button>
    </div>
  );
}

export default App;
